Hoy hace 3 años que ella, la Nina original, mi abuela, nos cuida desde el cielo. Qué difícil que es escribir esto, y qué alegría me da recordarla cada día de mi vida!!

Hoy hace 3 años que me llamaban de la clínica a las 03:15am a mi celular para pedirme que alguien de su familia fuera urgente. Totalmente impensado, mi abuela que toda su vida tuvo una salud de fierro, que casi no tomaba ningún remedio...

Nina se llama igual que mi abuela Tuta, la mamá de mi mamá!! Y no saben la alegría que me produce recordarla cada vez que nombro a mi hija. Ella era un ser mágico, ella me enseño a jugar a las cartas, me cocinaba las tartas de jamón y queso más ricas que probé en mi vida, con ella mirábamos el programa de Berugo Carámbula cada sábado por la noche (Alcoyana-Alcoyana) y era mi compañera de habitación cuando yo era chica, la mejor!! Mi abuela Tuta era la que le cantaba las mejores canciones a Nina de bebé, y le contaba siempre las mismas historias!! Me alegra que Nina haya podido conocerla, charlar y jugar con ella hasta sus casi 4 años!! Y que hoy la recuerde es tan emocionante que no les puedo explicar la felicidad que me da!!

Se que Tuta nunca se fue, sigue con nosotros, nos cuida, nos protege y nos acompaña todos los días, pero qué difícil es no verla desde hace 3 años, la pucha!! Extraño cuando me hacía enojar o cuándo se le antojaban todas las cosas dulces que siempre probaba en mi casa!! Recuerdo su felicidad cuando le contamos que la bebé que estaba en mi panza se iba a llamar como ella!! Se lo decía a todo el mundo con tanto orgullo ❤️ jejeje

Hoy agradezco haberla disfrutado tanto y que Nina haya podido conocerla!! No hay nada más lindo en la vida que el amor de una abuela!! Y de una bisabuela, ni te cuento!! 3 años pasaron ya! No puedo creerlo Tuta!!

Ustedes tienen el privilegio de tener a sus abuelas en esta vida?? O las recuerdan con tanta felicidad como yo?? Qué anécdotas tienen junto a ellas?? Conocieron a sus peques?? Las leo!! 👀

